On @climbinggold this week, we got some insight into what it's like to compete at a high level. @ashimashiraishi takes us through her experience at the Lead World Cup in Chamonix in 2019. Listen to "The Competitor's Mind" on Spotify at the link in my bio or wherever you find your podcasts. 

